import React from 'react';
import CoinList from '../components/CoinList';
import AddCoin from '../components/AddCoin';

function HomePage()
{
  return (
    <div className='homepage mt-2 rounded'>
    <div className="coinsummary shadow p-4 rounded  bg-light">
        <AddCoin />
        <CoinList />
    </div>
    </div>
  );
}

export default HomePage
